    }
    
    .fa-brands:before,
    .fa-classic:before,
    .fa-duotone:before,
    .fa-light:before,
    .fa-regular:before,
    .fa-sharp-duotone:before,
    .fa-sharp:before,

    .fass:before,
    .fast:before,
    .fat:before {
        content: var(--fa)
    }
    
    .fa-solid {
        font-family: "Font Awesome 6 Pro"
    }
    
    .fa-brands {
        font-family: "Font Awesome 6 Brands"
    }
    
    @media (prefers-reduced-motion:reduce) {}
    
    @keyframes fa-beat {
        0%,
        90% {
            transform: scale(1)
        }
        45% {
            transform: scale(var(--fa-beat-scale, 1.25))
        }
    }
    
    @keyframes fa-bounce {
        0% {
            transform: scale(1) translateY(0)
        }
        10% {
            transform: scale(var(--fa-bounce-start-scale-x, 1.1), var(--fa-bounce-start-scale-y, .9)) translateY(0)
        }
        30% {
            transform: scale(var(--fa-bounce-jump-scale-x, .9), var(--fa-bounce-jump-scale-y, 1.1)) translateY(var(--fa-bounce-height, -.5em))
        }
        50% {
            transform: scale(var(--fa-bounce-land-scale-x, 1.05), var(--fa-bounce-land-scale-y, .95)) translateY(0)
        }
        57% {
            transform: scale(1) translateY(var(--fa-bounce-rebound, -.125em))
        }
        64% {
            transform: scale(1) translateY(0)
        }
        to {
            transform: scale(1) translateY(0)
        }
    }
    
    @keyframes fa-fade {
        50% {
            opacity: var(--fa-fade-opacity, .4)
        }
    }
    
    @keyframes fa-beat-fade {
        0%,
        to {
            opacity: var(--fa-beat-fade-opacity, .4);
            transform: scale(1)
        }
        50% {
            opacity: 1;
            transform: scale(var(--fa-beat-fade-scale, 1.125))
        }
    }
    
    @keyframes fa-flip {
        50% {
            transform: rotate3d(var(--fa-flip-x, 0), var(--fa-flip-y, 1), var(--fa-flip-z, 0), var(--fa-flip-angle, -180deg))
        }
    }
    
    @keyframes fa-shake {
        0% {
            transform: rotate(-15deg)
        }
        4% {
            transform: rotate(15deg)
        }
        8%,
        24% {
            transform: rotate(-18deg)
        }
        12%,
        28% {
            transform: rotate(18deg)
        }
        16% {
            transform: rotate(-22deg)
        }
        20% {
            transform: rotate(22deg)
        }
        32% {
            transform: rotate(-12deg)
        }
        36% {
            transform: rotate(12deg)
        }
        40%,
        to {
            transform: rotate(0deg)
        }
    }
    
    @keyframes fa-spin {
        0% {
            transform: rotate(0deg)
        }
        to {
            transform: rotate(1turn)
        }
    }
    
    .fa-paper-plane {
        --fa: "";

    @media (min-width:640px) {
        .sm\:block {
            display: block
        }
        .sm\:gap-x-6 {
            -moz-column-gap: 1.5rem;
            column-gap: 1.5rem
        }
        .sm\:px-8 {
            padding-left: 2rem;
            padding-right: 2rem
        }
    }
    
    @media (min-width:768px) {
        .md\:w-\[240px\] {
            width: 240px
        }
        .md\:px-\[40px\] {
            padding-left: 40px;
            padding-right: 40px
        }
    }
    
    @media (min-width:1024px) {
        .lg\:px-\[75px\] {
            padding-left: 75px;
            padding-right: 75px
        }
        .lg\:text-5xl {
            font-size: 3rem;
            line-height: 1
        }
    }
    
    @media (min-width:1280px) {
        .xl\:left-\[300px\] {
            left: 300px
        }
        .xl\:block {
            display: block
        }
        .xl\:flex {
            display: flex
        }

            width: 275px

        .xl\:w-\[300px\] {
            width: 300px
        }
        .xl\:w-\[420px\] {
            width: 420px
        }

            border-bottom-left-radius: 1rem
        }
    }

        .\32xl\:left-\[350px\] {
            left: 350px
        }
        .\32xl\:w-\[350px\] {
            width: 350px
        }

    <script data-template-shadow-root>
        (() => {
            document.currentScript.remove();
            processNode(document);

            function processNode(node) {
                node.querySelectorAll("template[shadowrootmode]").forEach(element => {
                    let shadowRoot = element.parentElement.shadowRoot;
                    if (!shadowRoot) {
                        try {
                            shadowRoot = element.parentElement.attachShadow({
                                mode: element.getAttribute("shadowrootmode"),
                                delegatesFocus: element.getAttribute("shadowrootdelegatesfocus") != null,
                                clonable: element.getAttribute("shadowrootclonable") != null,
                                serializable: element.getAttribute("shadowrootserializable") != null
                            });
                            shadowRoot.innerHTML = element.innerHTML;
                            element.remove()
                        } catch (error) {}
                        if (shadowRoot) {
                            processNode(shadowRoot)
                        }
                    }
                })
            }
        })()
    </script>
